INSERT INTO `coursequestion` VALUES (1,1,1,''),(2,1,2,''),(3,1,3,''),(4,1,4,''),(5,1,5,''),(6,1,6,''),(7,2,1,'•	Explore the potential for meaning through interactive storytelling \r\n•	Develop understanding of the process of advancing plot and themes, and developing characters in an interactive story from idea to finished product \r\n•	Learn to evaluate and to modify'),(8,2,2,'In CS we use Process Oriented Guided Inquiry Learning as our pedagogy. Through teamwork, individual assignments, quizzes, team quizzes, tests, an individual project, and a final team-oriented project and final team presentation, we will complete our learn'),(9,2,3,'Creative writing, along with block coding, will be the primary focus of the first half of the semester. This is necessary to prepare students with the skills and techniques necessary to create a Public Service Announcement (PSA). Not all students that tak'),(10,2,4,'Community Partner: Berea Food Bank. Collaborate with Tony Crachiolo. The first half of the course is structured to get the students prepared to create an animation as a PSA. During the first half, Mr. Crachiolo will be invited to the class to talk to us a'),(11,2,5,'The proposed final product to be completed by students with be an animated PSA. The PSA will be informed by input from the Berea Food Bank, along with feedback to students from questions asked.'),(12,2,6,'All components of the service learning component for the course are combined in the Final Project category (22.5% of the total grade). The weighting of the internal components of service-learning, including reflection, the intermediate steps between the i'),(13,3,1,''),(14,3,2,''),(15,3,3,''),(16,3,4,''),(17,3,5,''),(18,3,6,''),(19,4,1,'Specific Objectives addressed through service-learning component. Students will\r\n•	demonstrate knowledge of basic health concepts during mini-teaching activities.\r\n•	develop and utilize creative methods of teaching health-related topics.\r\n•	create interventions, including lesson plans, using an approved format.\r\n•	incorporate physical, cognitive, and affective domains in objective and assessment plans.\r\n•	provide constructive feedback to their peers.\r\n•	receive evaluations by their peer and professor regarding their effectiveness.\r\n•	write up a self-analysis of their learning, planning, and teaching/presentation experiences.\r\n•	write reflectively about their active learning experiences.\r\n•	present health education interventions to participants in a community education program (off campus).\r\n'),(20,4,2,'Students are assigned weekly journal prompts, including those that allow them to assess and reflect on their progress towards meeting course objectives related to the project. The journal will be used for self-assessment in the planning, delivery, and evaluation stages of the program planning model we will use with our community partners. '),(21,4,3,'The students will be guided through a health program planning model by the instructor to assess the health educational needs of the clients of our community partner organization and then plan, deliver, and evaluate programming as part of the community partner’s two-week, intensive residential program. Tentative timeline:\r\n•	Initial meeting with community partner representative (on campus) = 1.5 hours\r\n•	Second meeting with community partner representative (partner site) = 1.5 hours\r\n•	Planning and conducting semi-structured interviews with community partner clients, programming providers, and staff = 4 hours\r\n•	Creating health lesson plans for clients of community partner and reviewing them with community partner (on campus) = 20 hours preparation + 2 hour review\r\n•	Teaching dates: November 12 & 14, 2024 = 4 hours\r\n•	Follow up meeting with community partner representative = 2 hours\r\n•	Formalizing lesson plans and report for partner organization = 10 hours\r\n'),(22,4,4,'Our community partner for this project and course is New Opportunity School for Women. The community partner will introduce their organization and mission and this service-learning project to HLT 300 students in the second week of the semester. Early into the semester, HLT 300 will visit the community partner site and observe the environment in which they will teach and learn more about past programming and the community’s partners educational wishes for their fall residential program clients. The community partner will contribute to primary needs assessment by arranging and giving interviews to HLT 300 students. The community partner representative will review and approve lesson plans created by HLT 300 for the fall residential program. The community partner will provide feedback and client responses to HLT 300 students to assist in their evaluation of their programming. '),(23,4,5,'HLT 300 students will complete, use, and revise health lesson plans for NOSW residential program participants and give these plans to NOSW to use in the future. HLT 300 students will complete a programming planning report and summary and give it to the community partner for their records. \r\nNew Opportunity School for Women clients benefit greatly from the partnership formed by HLT 300 and NOSW, ensuring they receive high-quality, evidence-based, tailored, important and relevant messages, lessons, and information about taking care of and advocating for their health. \r\n'),(24,4,6,'HLT students will submit drafts of their work (secondary needs assessment, primary needs assessment, educational priorities, learning objectives, logic model, teaching and evaluation plans) throughout the planning process and will receive credit for submissions and feedback for their final submission. Students will receive a grade for their final submission of their entire, formalized program planning document. Students receive rubrics to guide their drafts of project components and final submission. The final submission grade is 20% of the overall course grade. Daily class assignments/reading accountability related to the SL project contribute to10% of the overall course grade and weekly reflections related to SL project contribute to nearly 10% of the overall course grade. \r\n'),(25,5,1,''),(26,5,2,''),(27,5,3,''),(28,5,4,''),(29,5,5,''),(30,5,6,'');
/*!40000 ALTER TABLE `coursequestion` ENABLE KEYS */;
UNLOCK TABLES;

