ahaza',0,'This is an extension of the larger AGP event in which our track team will come and help make Valentine\'s holiday cards for our residents.',NULL,1,0),(180,'Habitat Connect #3',9,'18:00:00','20:00:00','Stephenson 214',1,0,0,0,'2023-02-15','2023-02-15',NULL,'habitat@berea.edu','Chase Ackerman',1,'Join the Habitat Team in celebration of Black History Month, as we watch the movie \"Pursuit of Happyness\" and have meaningful conversations about homelessness and equity.\r\n\r\nNacho bar provided!',NULL,5,0),(181,'The Art of Aging ',10,'19:00:00','20:00:00','Activities Room ',0,0,1,0,'2023-02-23','2023-02-23',NULL,'pwc@berea.edu','Maryam Al Tatooz',0,'Hello!\r\n \r\nThe People Who Care team would like to invite to our Café Social Justice event titled “The Art of Aging” on Thursday February 23th from 7:00 to - 8:00 p.m. at Stephenson Hall, 2nd floor Activities Room 214.\r\n \r\nPlease join us in a conversation ',NULL,7,0),(182,'AGP Talent Show',9,'14:00:00','18:00:00','Pick up from Alumni Circle',0,1,1,0,'2023-03-19','2023-03-19',NULL,'agp@berea.edu','Aimee Ninahaza',0,'Can you sing, dance, play an instrument, etc...?\r\nCome share your talent with residents at Irvine Nursing and Rehabilitation on March 19th. Pick-ups will be from Alumni Circle at 2:00 pm and will return to Berea by 6 pm.\r\n\r\nYour precious time will be grea',NULL,1,0),(183,'Cafe SJ: Our Berea Neighbors ',9,'19:00:00','20:00:00','Activities Room (214), Stephenson\'s Hall',0,0,0,0,'2023-03-16','2023-03-16',NULL,'pwc@berea.edu','Maryam Al Tatooz',0,'This event is a collaboration between People Who Care & Habitat for Humanity. ',NULL,7,0),(185,'Animal Shelter Service Trip',9,'08:30:00','14:30:00','CELTS 2nd Floor',0,1,1,0,'2023-03-25','2023-03-25',NULL,'vargasn@berea.edu','Noah Vargas',0,'THIS EVENT IS CURRENTLY FULL - IF YOU SIGN UP YOU\'LL BE ON THE WAITLIST. THERE WILL BE AN APRIL EVENT; WAITLIST PEOPLE WILL GET FIRST PRIORITY.\r\n\r\nThis trip is in Partnership with the Estill County Animal Shelter and CELTS. Students will meet at 8:30 am i',NULL,9,0),(186,'People Who Care Eastern Kentucky Service Trip',9,'08:00:00','17:00:00','Hazard, Kentucky',0,0,1,0,'2023-03-18','2023-03-18',NULL,'pwc@berea.edu','Maryam Al Tatooz',0,'Come and help us sort donations to help Eastern Kentucky flood survivors. ',NULL,7,0),(187,'Habitat Connect #4',9,'18:00:00','19:00:00','Stephenson 214',0,0,1,0,'2023-03-22','2023-03-22',NULL,'habitat@berea.edu','Chase Ackerman',0,'The fourth event in the semester sub-programming that our team has done. This time we will be collaborating jointly with People Who Care for a small presentation, than a night of games and community building.',NULL,5,0),(188,'Habitat Homeless Shelter Trip',9,'10:00:00','16:00:00','Richmond, KY',0,1,1,0,'2023-04-01','2023-04-01',NULL,'habitat@berea.edu','Chase Ackerman',0,'Habitat invites you to join us this weekend in Richmond, KY for a day of repair work and organization at a local homeless shelter. This trip will include projects of various skill levels, some of which may include (though are not limited to):\r\n\r\n1) repair',NULL,5,0),(189,'Roaring 20s Party',9,'14:00:00','18:00:00','Irvine Nursing and Rehabilitation (Pick up from Alumni Circle)',0,1,1,0,'2023-04-23','2023-04-23',NULL,'agp@berea.edu','Aimee Ninahaza',0,'Who’s ready to party? Join AGP as we bring the decade of parties to Irvine Nursing and Rehabilitation Facility at our Roaring 20s party! We plan to have an evening of fun with our residents with 20s-themed decorations, snacks, and games like dominos and Yahtzee. We will also have a jazz playlist to encourage our residents to dance. Dressing up is encouraged but not required.  ',NULL,1,0),(190,'Empty Bowls ',9,'17:30:00','19:00:00','Woods-Penn',0,0,1,0,'2023-03-30','2023-03-30',NULL,'celts@berea.edu','CELTS Admin',0,'Empty Bowls will take place at Berea College Woods-Penniman Commons on March 30th at 5:30 p.m. Tickets for the event will cost $15; in exchange, attendees will be served a bowl of soup with their choice of a ceramic bowl. The bowls are all handmade by Berea College ceramic students and the above mentioned local potters. All the event proceeds will go to the Berea Food Bank. Tickets may be purchased in the CELTS office (Stephenson 205) starting on Monday, March 27 through Wednesday, March 29, 9 a.m. to 11:30 a.m. and 1:30 to 4:30 p.m., in the Alumni Lounge noon to 1 p.m., Monday through Wednesday,  or at the event on Thursday. ',NULL,8,0),(191,'Easter Egg Hunt',9,'15:00:00','18:00:00','Irvine Nursing and Rehabilitation (Pick up from Alumni Circle)',0,1,1,0,'2023-04-06','2023-04-06',NULL,'agp@berea.edu','Aimee Ninahaza',0,'Join us this Thursday for a fun Easter Egg Hunt with our lovely Irvine Nursing and Rehabilitation residents.\r\n\r\nWe\'ll all be delighted to have you around!',NULL,1,0),(192,'Habitat Connect #5',9,'18:00:00','19:00:00','CELTS Arts & Crafts',0,1,1,0,'2023-04-05','2023-04-05',NULL,'habitat@berea.edu','Chase Ackerman',0,'Join the Habitat team for a Wednesday evening of chill crafts and community building. \r\n\r\nPlease invite your friends!',NULL,5,0),(193,'AGP Volunteer Opportunity - Dominion Senior Living  Week 1',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10-04','2022-10-04',14,'agp@berea.edu','Aimee Ninahaza',0,'Join us for a fun night with Dominion residents!',NULL,1,0),(194,'AGP Volunteer Opportunity - Dominion Senior Living  Week 2',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10-11','2022-10-11',14,'agp@berea.edu','Aimee Ninahaza',0,'Join us for a fun night with Dominion residents!',NULL,1,0),(195,'AGP Volunteer Opportunity - Dominion Senior Living  Week 3',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10-18','2022-10-18',14,'agp@berea.edu','Aimee Ninahaza',0,'Join us for a fun night with Dominion residents!',NULL,1,0),(196,'AGP Volunteer Opportunity - Dominion Senior Living  Week 4',9,'17:30:00','19:30:00','Pick up from Alumni Circle',0,1,1,0,'2022-10