,'hop@berea.edu','Sabdi Lopez Jimenez',0,'Weekly English Language Learner Tutoring',NULL,6,0),(235,'Weekly ELL Tutoring Week 10',9,'18:00:00','19:00:00','Madison County Public Library ',0,0,1,0,'2023-04-05','2023-04-05',17,'hop@berea.edu','Sabdi Lopez Jimenez',0,'Weekly English Language Learner Tutoring',NULL,6,0),(236,'Weekly ELL Tutoring Week 11',9,'18:00:00','19:00:00','Madison County Public Library ',0,0,1,0,'2023-04-12','2023-04-12',17,'hop@berea.edu','Sabdi Lopez Jimenez',0,'Weekly English Language Learner Tutoring',NULL,6,0),(237,'Weekly ELL Tutoring Week 12',9,'18:00:00','19:00:00','Madison County Public Library ',0,0,1,0,'2023-04-19','2023-04-19',17,'hop@berea.edu','Sabdi Lopez Jimenez',0,'Weekly English Language Learner Tutoring',NULL,6,0),(238,'Weekly ELL Tutoring Week 13',9,'18:00:00','19:00:00','Madison County Public Library ',0,0,1,0,'2023-04-26','2023-04-26',17,'hop@berea.edu','Sabdi Lopez Jimenez',0,'Weekly English Language Learner Tutoring',NULL,6,0),(239,'Cafe SJ: Healthcare for Her',9,'19:00:00','20:00:00','Stephenson\'s Hall - Activities Room (214)',0,0,1,0,'2023-04-27','2023-04-27',NULL,'pwc@berea.edu','Maryam Al Tatooz',1,'Hello everyone!\r\n \r\n            We would like to invite you to our final Café SJ of the semester titled, “Healthcare for Her: Promoting Reproductive Education for Girls in Iraq” on Thursday, April 27th from 7-8 pm at Stephenson Hall 2nd floor room 214 (Activities Room). This event is in collaboration with IFMSA-Iraq (a non-governmental organization that supports medical students all over the world).\r\n \r\n              Join us for light snacks and refreshments while we prepare menstrual hygiene kits to be shipped to Iraq! We would greatly appreciate your help and hope you stop by to learn about the importance of promoting menstrual health and hygiene. ????\r\n \r\nA big thanks to Heart and the Bonner Scholars’ generosity in helping us supply goods for the kits!\r\n \r\nYours in service,\r\n \r\nThe People Who Care team',NULL,7,0),(240,'Service Trip: GreenHouse17',9,'11:00:00','17:00:00','Lexington, Kentucky',0,1,1,0,'2023-02-11','2023-02-11',NULL,'pwc@berea.edu','Maryam Al Tatooz',0,'Hello fellow PWC volunteers!\r\n \r\n              Thank you again for sharing your interest in becoming a People Who Care volunteer. We are extremely excited to share our first volunteer opportunity for Spring 2023 with GreenHouse17 happening Saturday, February 11th from 1-5 pm.  (please refer to the link to learn more about GreenHouse17 – a non-profit organization committed to ending intimate partner abuse in families and the community)\r\n \r\nWe will be traveling to Lexington – Bryan Station Kroger to hand out wish lists to shoppers and collect donations in carts. We will be providing transportation and will be meeting in front of the Stephenson Hall building entrance at 11:50 pm.\r\n \r\nThis is in support of GreenHouse17’s donation drive event, “Shop and Share”. This event usually helps them raise all of the nonperishable goods they need at the emergency shelter for nearly the entire year!\r\nWe hope this is a service trip you are interested in. Your help will go as far as supporting survivors throughout the year. If you have any questions, please do not hesitate to contact us!\r\n \r\nPlease complete the google form linked below to RSVP:\r\nhttps://forms.gle/r5ZLAGrJvzt1BxJy8\r\n \r\nWith appreciation and yours in service,\r\n \r\nThe People Who Care team \r\nCenter for Excellence in Learning Through Service (CELTS)\r\nBerea College\r\nCELTS CPO 2170\r\n859-985-3136',NULL,7,0),(241,'Service Trip: Eastern Kentucky',9,'08:00:00','17:00:00','Hazard, Kentucky',0,1,1,0,'2023-02-25','2023-02-25',NULL,'pwc@berea.edu','Maryam Al Tatooz',0,'Hello, People Who Care volunteers!\r\n \r\n              We are, again, excited to share another service with First Presbyterian Church at Hazard, Kentucky helping organize and sort donations for survivors of the Eastern Kentucky floods that occurred during the Summer of 2022.\r\n \r\nThis service trip will be happening Saturday, March 18th from 8 am - 5 pm.\r\n \r\nWe will be providing transportation (about a 2-hour drive there and back) and will be meeting in front of the Stephenson Hall building entrance at 8 am. We will also be providing breakfast and lunch!\r\n \r\nThis is in support of Eastern Kentucky individuals who have been impacted by the extreme floods reported July 26-29 of 2022. We will also be supporting the First Presbyterian Church who is currently overwhelmed with donations to be sorted and distributed to their community. The First Presbyterian Church has served as an emergency shelter for flood victims and continues to offer their space for flood relief.\r\n \r\nYour help would be kindly appreciated ???? If you have any questions, please do not hesitate to contact us!\r\n \r\nPlease complete the google form linked below to RSVP:\r\nhttps://forms.gle/meL28ExfMdxm7kx36\r\nWith appreciation and yours in service,\r\n \r\nThe People Who Care team \r\nCenter for Excellence in Learning Through Service (CELTS)\r\nBerea College\r\nCELTS CPO 2170\r\n859-985-3136',NULL,7,0),(242,'Service Trip: Habitat for Humanity',9,'10:00:00','16:00:00','Richmond, Kentucky',0,1,1,0,'2023-04-01','2023-04-01',NULL,'pwc@berea.edu','Maryam Al Tatooz',0,'Hey friends!\r\n             \r\n              Would you like to attend a collaborative service trip with Habitat for Humanity this Saturday April 1st? (most likely will leave campus between 8am-9am, but more info to come) We plan to go to a homeless shelter that is in great need of repairs, decluttering, and cleaning up. We have listed a few of the projects that have been asked for:\r\n \r\nProject 1- The shelter has a sliding panel door leading to their electrical closet which they would like repaired. You\'d have to attach sliders to the bottom of the existing panel and fix the upper part of the frame so that it\'ll slide correctly.\r\nProject 2- The stairway/entrance to the shelter needs to be cleaned up a bit. They have stone stairs which need to be repaired a little bit. (instructions and guidance to be provided)\r\nProject 3- One of the door frames inside the bathrooms was removed for some plumbing work, which has since finished. They\'d like us to repair the wall and paint over it.\r\nProject 4- The second and third floors are a bit of a mess in terms of the floors and clutter everywhere. They\'d like us to try our best to get the floors cleaned and the materials organized. \r\n \r\nGiven that we will be handling tools, habitat for humanity will provide us with a quick training this Friday before the trip. (more details to come soon on the time slots)\r\nIf you are interested in giving us a hand or are in need of service hours please reply to this email saying so! ????\r\n \r\nThank you and yours in service,\r\n \r\nThe People Who Care team \r\nCenter for Excellence in Learning Through Service (CELTS)\r\nBerea College\r\nCELTS CPO 2170\r\n859-985-3136',NULL,7,0),(243,'Habitat for Humanity Spring 2023 Collegiate Challenge',9,'08:00:00','16:00:00','Johns Island, SC',0,0,1,0,'2023-03-07','2023-03-07',NULL,'habitat@berea.edu','Chase Ackerman',0,'This is the first day of our Spring Collegiate Challenge volunteering!',NULL,5,0),(244,'Habitat for Humanity Spring 2023 Collegiate Challenge Day 2',9,'08:00:00','16:00:00','Johns Island, SC',0,0,1,0,'2023-03-08','2023-03-08',NULL,'habitat@berea.edu','Chase Ackerman',0,'This is the second day of our Spring Collegiate Challenge volunteering!',NULL,5,0),(245,'Habitat for Humanity Spring 2023 Collegiate Challenge Day 3',9,'08:00:00','16:00:00','Johns Island, SC',0,0,1,0,'2023-03-09','2023-03-09',NULL,'habitat@berea.edu','Chase Ackerman',0,'This is the third day of our Spring Collegiate Challenge.',NULL,5,0),(246,'Día de los Muertos',9,'19:00:00','20:30:00','Alumni - Baird Lounge',0,0,0,0,'2023-01-01','2023-01-01',NULL,'hop@berea.edu','Sabdi Lopez Jimenez',1,'In collaboration with the Espacio Cultural Latinx (ECL), the Hispanic Outreach Program (HOP) of CELTS would like to invite you to visit the altars that we have set up in celebration of Día de los Muertos. Día de los Muertos is a celebration from October 31st- November 2nd where families gather to honor and remember deceased loved ones. The two altars are set up in the lobby of Hutchins Library and at the ECL on the ground floor of Alumni. The altars will be up for about two weeks starting October 25th. We invite everyone to visit the altars and write a message or bring pictures of your deceased loved ones!',NULL,6,0),(247,'Garden Tub Painting',9,'14:00:00','16:00:00','Room 226, Stephenson\'s Building',0,0,0,0,'2023-04-16','2023-04-16',NULL,'hop@berea.edu','Sabdi Lopez Jimenez',0,'A FREE activity for families with children ages 4-18! Each family can sign up to paint one tub. SPACE IS LIMITED so sign up in the link above. Soil and seeds will be provided for each family. ',NULL,6,0),(248,'HOP Talks: Maxwell Street Legal Clinic',9,'18:00:00','19:00:00','Carter G. Woodson Center',0,0,0,0,'2023-04-11','2023-04-11',NULL,'hop@berea.edu','Sabdi Lopez Jimenez',0,'Join us for a presentation and discussion about how housing benefits, Medicaid, and human rights issues intersect with immigration. We will give a brief overview of common immigration myths.',NULL,6,0),(249,'Supper and Reception for Karina Barillas',9,'17:30:00','19:00:00','Carter G. Woodson Center',0,0,0,0,'2023-03-23','2023-03-23',NULL,'hop@berea.edu','Sabdi Lopez Jimenez',1,'Supper and reception to honor Karina Barillas, 2023 Berea College Service Award recipient, open to the campus community (primarily students), Carter G. Woodson Center for Interracial Education, Alumni Building.',NULL,6,0),(250,'Family Night at Berea Community Elementary School',9,'18:00:00','19:30:00','BCES',0,0,0,0,'2023-02-07','2023-02-07',NULL,'hop@berea.edu','Sabdi Lopez Jimenez',0,'Family Night to promote our after-school club.',NULL,6,0),(251,'English Language Learner Training',9,'09:00