alth in our community.\r\n\r\nThe director of community outreach, Tracy Nolan, will be there to discuss what the Red Bird Mission is, the impact of public health initiatives, and how she has seen it change the community she serves. We will then be constructing medical-care kits to donate to Red Bird Mission, and we appreciate all of the help we can get!',NULL,7,0),(486,'Habitat Connect 4',11,'18:00:00','19:00:00','Stephenson Hall, Activities Room (214)',0,0,1,0,'2023-11-08','2023-11-08',NULL,'habitat@berea.edu','Maria Elkins',1,'Come relax and have fun with the Habitat team while we explore volunteerism and service to others through arts, crafts, games, and more!',NULL,5,0),(487,'Richmond Build Opportunity',11,'09:00:00','15:00:00','Richmond',0,1,1,0,'2023-11-04','2023-11-04',NULL,'habitat@berea.edu','Maria Elkins',1,'Come join the Habitat team this Saturday working on porch repairs for Habitat homeowners!',3,5,0),(488,'Habitat Office Volunteering',11,'15:00:00','17:00:00','Richmond, KY',0,1,1,0,'2023-11-10','2023-11-10',NULL,'habitat@berea.edu','Maria Elkins',0,'Come help out at the Habitat office with cleaning, organizing, and more in support of our wonderful community partner!',2,5,0),(489,'Fall Festival at Irvine Nursing and Rehab',11,'12:45:00','16:00:00','Irvine Nursing and Rehab in Irvine, KY',0,1,1,0,'2023-11-19','2023-11-19',NULL,'agp@berea.edu','Andrea Patton',1,'Join us as we celebrate the fall season with the Irvine community! For this event, we will be engaging, alongside our wonderful participants, in a fall-themed craft, apple cider tasting, hand-painted Polaroid photo opp stations, and more! \r\n\r\nPick-up will be at Alumni Circle at 12:45 pm and we will arrive back on campus by 4:00 pm!  ',NULL,1,0),(490,'Bonfires are Better Together',11,'19:00:00','23:00:00','Corner of Estill and Main St, Stephenson Gravel Parking Lot',0,0,1,0,'2023-11-16','2023-11-16',NULL,'celts@berea.edu','CELTS Admin',1,'As a part of the Better Together campaign, we invite the