st beforehand if possible. Lunch is provided.\r\n4. There are limited spots, possibly 12 total in two CELTS vans. Don\'t wait to RSVP if you want to join!\r\n5. RSVP\'s are due by Friday, January 12th by 11:59 PM on CELTSlink, and spots are filled on a first-come, first served basis.\r\n',14,9,1),(497,'Monday Afternoon Programming Week 1',12,'15:30:00','17:30:00','Dominion Senior Living in Richmond, KY',0,1,1,0,'2024-02-12','2024-02-12',34,'agp@berea.edu','Andrea Patton',0,'We will be traveling to Dominion Senior Living in Richmond, KY to host programming. Pick-up will always be at 3:30 pm at Alumni Circle and drop-off will either be at the CELTS space or the Alumni Circle at 5:30 pm. ',NULL,1,0),(498,'Monday Afternoon Programming Week 2',12,'15:30:00','17:30:00','Dominion Senior Living in Richmond, KY',0,1,1,0,'2024-02-19','2024-02-19',34,'agp@berea.edu','Andrea Patton',0,'We will be traveling to Dominion Senior Living in Richmond, KY to host programming. Pick-up will always be at 3:30 pm at Alumni Circle and drop-off will either be at the CELTS space or the Alumni Circle at 5:30 pm. ',NULL,1,0),(499,'Monday Afternoon Programming Week 3',12,'15:30:00','17:30:00','Dominion Senior Living in Richmond, KY',0,1,1,0,'2024-02-26','2024-02-26',34,'agp@berea.edu','Andrea Patton',0,'We will be traveling to Dominion Senior Living in Richmond, KY to host programming. Pick-up will always be at 3:30 pm at Alumni Circle and drop-off will either be at the CELTS space or the Alumni Circle at 5:30 pm. ',NULL,1,0),(501,'Monday Afternoon Programming Week 4',12,'15:30:00','17:30:00','Dominion Senior Living in Richmond, KY',0,1,1,0,'2024-03-11','2024-03-11',34,'agp@berea.edu','Andrea Patton',0,'We will be traveling to Dominion Senior Living in Richmond, KY to host programming. Pick-up will always be at 3:30 pm at Alumni Circle and drop-off will either be at the CELTS space or the Alumni Circle at 5:30 pm. ',NULL,1,0),(502,'Monday Afternoon Programming Week 5',12,'15:30:00','17:30:00','D