024-01-30',NULL,'habitat@berea.edu','Maria Elkins',0,'Come get trained with Habitat to attend volunteer opportunities!',NULL,5,0),(549,'Habitat-Specific Training',12,'17:00:00','18:00:00','Stephenson Hall, Room 226',1,1,1,0,'2024-01-31','2024-01-31',NULL,'habitat@berea.edu','Maria Elkins',0,'Come join Habitat to get trained to attend volunteer opportunities!',NULL,5,0),(550,'HOP ELL (English Language Learner) Tutor Training',12,'09:00:00','15:00:00','Stephenson Hall 208 (CELTS Arts and Crafts Room)',1,1,0,0,'2024-01-27','2024-01-27',NULL,'hop@berea.edu','Brandon Zuniga',1,'Participants in this training will develop their knowledge and skills related to supporting others in developing English Language Skills. While HOP isn\'t currently recruiting volunteers, we are pleased to offer this training in collaboration with Madison County Adult Education Program as a professional development opportunity. Participants must commit to attending the full training (9 a.m. to 3 p.m.). Participants should bring a laptop or phone to access resources during the training. Certificate of completion will be provided to participants. Lunch at Dining Services provided by CELTS, as well as snacks throughout the day. \r\n\r\nSummary of Event:\r\nParticipant has successfully completed the 5-hour English Language Learning (ELL) Tutor Training provided by the Hispanic Outreach Program in collaboration with the Madison County Adult Education Program. Attendees of this training enhanced their expertise and proficiency in assisting others with the development of language skills.',NULL,6,0),(551,'Super Bowl Watch Party',12,'16:00:00','20:00:00','Lexington, KY',0,1,1,0,'2024-02-11','2024-02-11',NULL,'agp@berea.edu','Andrea Patton',1,'For this event, our team will be collaborating with the Memory Cafe & Alzheimer\'s Association Support Group of Lexington, KY. The event will be hosted at the Fayette County Extension Office. We will meet at the Alumni Circle at 4 pm to depart from campus. We expect to arrive at the Extension Office at 5 pm to help set up for the event, watch the game/half-time show, and enage in activities before departing around 7 pm. You can expect to arrive back on campus by 8 pm. ',NULL,1,0),(552,'PWC Specific Training',12,'09:00:00','19:00:00','Stephenson\'s Hall Connector',1,0,0,0,'2024-01-26','2024-01-26',NULL,'pwc@berea.edu','Kimberly Tamayo-Quinones',0,'People Who Care Specific Training for potential volunteers. Spring 2024. Drop-ins. ',NULL,7,0),(553,'All Volunteer Training',12,'17:30:00','18:30:00','Stephenson Activities Room',1,0,0,1,'2024-01-24','2024-01-24',NULL,'celts@berea.edu','CELTS Admin',0,'Training for all CELTS programs',NULL,9,0),(554,'GreenHouse17 Shop & Share 2024',18,'08:00:00','14:00:00','Lexington, KY',0,1,1,0,'2024-02-10','2024-02-10',NULL,'pwc@berea.edu','Kimberly Tamayo-Quinones',0,'Shop & Share is Greenhouse 17\'s annual one-day donation drive. They have volunteers stationed in each Kroger in their 17-county service area, handing out a \"needs list\" to interested shoppers, who can purchase items from the list and leave the items with the volunteers in the store. Our shift lasts from 9 AM to 1 PM, and after that the donations brought to the shelter are sorted and stored. This one day usually helps raise all of the non-perishable goods that they need for the entire year!  ',6,7,0),(555,'All Volunteer Training',12,'18:00:00','19:00:00','Stephenson Activities Room',1,0,0,1,'2024-01-25','2024-01-25',NULL,'celts@berea.edu','CELTS Admin',0,'Training for all CELTS programs',NULL,9,0),(556,'Valentine\'s Day Card Making ',12,'16:00:00','17:00:00','Stephenson Hall 2nd Floor Room 226',0,1,1,0,'2024-02-07','2024-02-07',NULL,'agp@berea.edu','Andrea Patton',0,'Hi, friends! Please join us in making Valentine\'s Day cards to deliver to our lovely Dominion Senior Living Community in Richmond, KY! If you are an official AGP volunteer, please also feel free to join us for programming the week of Valentine\'s Day (Mon. 2/12/24 & Wed. 2/14/24) to help our team deliver the cards you make! ',NULL,1,0),(557,'AGP Specific Training Session ',12,'17:00:00','18:00:00','Stephenson Hall 2nd Floor Arts & Crafts Room ',1,0,1,0,'2024-01-30','2024-01-30',NULL,'agp@berea.edu','Andrea Patton',0,'Please join us for a brief training session on 1/30/24 from 5-6 pm, located in the Arts and Crafts room on the 2nd floor of Stephenson Hall. If you plan to volunteer with AGP this semester and did not receive this training in the fall \'23 semester, it is MANDATORY to attend this training before you can join our team for programming! If you are unable to attend this training, please reach out to our Program Manager, Andrea Patton, to arrange an alternative training session! ',NULL,1,0),(558,'Hunger + Houselessness: Cooking Night 1',12,'14:30:00','18:00:00','Stephenson 2nd Floor Kitchen',0,1,1,0,'2024-02-09','2024-02-09',NULL,'genslerh@berea.edu','Halle Gensler',0,'Berea College\'s Center for Excellence for Learning Through Service (CELTS) hosts two annual hunger initiative fundraisers to support the local food bank each school semester. The project involves students supporting the nonprofit, Room in the Inn, to fulfill the direct need of the under-housed community, as people may only visit the Food Bank once a month. Students will be working in a team setting to create over 30 warm, nutritious meals along with finalizing the morning-bags with two more meals. This week\'s cuisine was inspired by Asian cuisine, including a fresh vegetable slaw and decorated sugar cookies.',NULL,8,0),(559,'Hunger + Houselessness: Cooking Night 2',12,'14:30:00','18:00:00','Stephenson 2nd Floor Kitchen',0,1,1,0,'2024-02-16','2024-02-16',NULL,'genslerh@berea.edu','Halle Gensler',0,'Berea College\'s Center for Excellence for Learning Through Service (CELTS) hosts two annual hunger initiative fundraisers to support the local food bank each school semester. The project involves students supporting the nonprofit, Room in the Inn, to fulfill the direct need of the under-housed community, as people may only visit the Food Bank once a month. Students will be working in a team setting to create over 30 warm, nutritious meals along with finalizing the morning-bags with two more meals. This week\'s cuisine was inspired by Latinx cuisine, including fresh Pico de Gallo, guacamole, and decorated sugar cookies.',NULL,8,0),(560,'Hunger + Houselessness: Cooking Night 3',12,'14:30:00','18:00:00','Stephenson 2nd Floor Kitchen',0,1,1,0,'2024-02-23','2024-02-23',NULL,'genslerh@berea.edu','Halle Gensler',0,'Berea College\'s Center for Excellence for Learning Through Service (CELTS) hosts two annual hunger initiative fundraisers to support the local food bank each school semester. The project involves students supporting the nonprofit, Room in the Inn, to fulfill the direct need of the under-housed community, as people may only visit the Food Bank once a month. Students will be working in a team setting to create over 30 warm, nutritious meals along with finalizing the morning-bags with two more meals. This week\'s cuisine was inspired by Italian cuisine, including home-made chicken parmesan and decorated sugar cookies.',NULL,8,0),(561,'All Bonner Meeting Spring 2024',12,'17:00:00','19:00:00','Stephenson 216',0,0,0,0,'2024-01-28','2024-01-28',NULL,'celts@berea.edu','CELTS Admin',1,'The required Spring 2024 All Bonner Meeting with important Bonner updates, information and community time.',NULL,10,0),(562,'CELTS/VEPAC Day at the Kentucky State Capitol',12,'06:00:00','17:00:00','Kentucky State Capitol, Frankfort, KY',0,1,0,0,'2024-02-13','2024-02-13',NULL,'celts@berea.edu','CELTS Admin',1,'*This event is full.* \r\n\r\nJoin CELTS, VEPAC, and community partner KFTC (Kentuckians for the Commonwealth) at the Kentucky State Capitol Building in Frankfort, Kentucky, to observe elements of the legislative process and meet with legislators, related to voter rights restoration for returning citizens. This trip will be February 13, 2024 (6:15 AM - 4:30 PM). During this time, you will have the opportunity to meet with legislators in groups with other KFTC volunteers and discuss talking points identified by KFTC to support voting restoration. \r\n\r\nParticipants are required to attend a mandatory training on Thursday, February 8th at 4:30 PM, where we will discuss the agenda for the day and how best to prepare.\r\n\r\n*RSVP on CELTS link is required as spots are limited. Lunch and transportation will be provided for all attendees. We will email you to confirm your spot.\r\n',15,9,0),(563,'Habitat Connect ',12,'17:00:00','18:00:00','Activities Room (214)',0,1,1,0,'2024-02-08','2024-02-08',NULL,'habitat@berea.edu','Maria Elkins',0,'Our first Habitat Connect of the semester!',NULL,5,0),(564,'Berea Teen Mentoring Weekly Programming Week 1',19,'17:00:00','20:00:00','Stephenson ',0,0,0,0,'2024-02-08','2024-02-08',38,'bereateenmentoring@berea.edu','Kori Kobylak',1,'Weekly CELTS programming for BTM! We will go to dining first and then do programing around campus.',NULL,3,0),(565,'Berea Teen Mentoring Weekly Programming Week 2',19,'17:00:00','20:00:00','Stephenson ',0,0,0,0,'2024-02-15','2024-02-15',38,'bereateenmentoring@berea.edu','Kori Kobylak',1,'Weekly CELTS programming for BTM! We will go to dining first and then do programing around campus.',NULL,3,0),(566,'Berea Teen Mentoring Weekly Programming Week 3',19,'17:00:00','20:00:00','Stephenson ',0,0,0,0,'2024-02-22','2024-02-22',38,'bereateenmentoring@berea.edu','Kori Kobylak',1,'Weekly CELTS programming for BTM! We will go to dining first and then do programing around campus.',NULL,3,0),(567,'Berea Teen Mentoring Weekly Programming Week 4',19,'17:00:00','20:00:00','Stephenson ',0,0,0,0,'2024-02-29','2024-02-29',38,'bereateenmentoring@berea.edu','Kori Kobylak',1,'Weekly CELTS programming for BTM! We will go to dining first and then do programing around campus.',NULL,3,0),(568,'Berea Teen Mentoring Weekly Programming Week 5',19,'17:00:00','20:00:00','St