k Alzheimer\'s & Dementia with AGP!',12,'12:00:00','16:00:00','Legacy Reserve in Lexington, KY',0,1,1,0,'2024-04-28','2024-04-28',NULL,'agp@berea.edu','Andrea Patton',0,'Join the AGP team as we host an educational activity for the independent & personal care community of Legacy Reserve in Lexington, KY. We will be sharing information about Alzheimer\'s and dementia, examining how and why these age-related conditions affect balance and motor skill function, and offering strategies for navigating these changes with grace and the preservation of dignity/independence. We plan to depart from Alumni Circle at 12:00 pm, arrive at Legacy Reserve at 1:00 pm, and briefly set up/prepare for the event to begin at 1:30 pm. We aim to conclude the event at 2:30 pm, depart from Legacy Reserve at 3:00 pm, and return to campus by 4:00 pm.',NULL,1,0),(655,'Free Book Fair',12,'17:00:00','20:00:00','Woods Penn Lounge',0,1,1,0,'2024-04-12','2024-04-12',NULL,'pwc@berea.edu','Kimberly Tamayo-Quinones',1,'We will be holding a Free Book Fair on Friday, April 12th from 5-8pm, at Woods-Penn Lounge (basement floor). We will have books for children and young adults, with a focus on diverse content. Additionally, we will have snacks, drinks, free bookmarks, and a bookmark making station!\r\nOur goal with this Book Fair is to create a welcoming environment to anyone who would like a new book (or a few)! ',NULL,7,0),(656,'Book Comprehension Questions',12,'15:00:00','17:30:00','Stephenson 212',0,0,1,0,'2024-04-03','2024-04-03',NULL,'bereatutoring@berea.edu','Fay Moore',0,'Volunteers will help build comprehension questions for new books added to the library.',NULL,4,0),(657,'Habitat ReStore Window Painting',12,'10:00:00','15:00:00','Richmond, KY',0,1,1,0,'2024-04-13','2024-04-13',NULL,'habitat@berea.edu','Maria Elkins',1,'Come help support the Habitat ReStore through window art! Lunch and transportation provided.',5,5,0),(659,'Tutoring Thursday Session  Week 1',17,'17:00:00','19:00:00','Stephenson Ha