INSERT INTO `program` VALUES (1,'Adopt-a-Grandparent',NULL,1,0,'Andrea Patton','agp@berea.edu','Adopt-a-Grandparent (AGP) is an outreach program for Berea elders. The program matches college student volunteers with residents of local long-term care centers. Volunteers visit with residents for at least an hour per week, and participate in special monthly programs.','',0,'https://www.instagram.com/agp_celts/','https://www.berea.edu/centers/center-for-excellence-in-learning-through-service/programs/adopt-a-grandparent','https://www.facebook.com/profile.php?id=100085958053273'),(2,'Berea Buddies',NULL,1,0,'Jenna Blakey','bereabuddies@berea.edu','The Berea Buddies program is dedicated to establishing long-term mentorships between Berea youth (Little Buddies) and Berea College students (Big Buddies). Volunteers serve children by offering them friendship and quality time. Big and Little Buddies meet each other every Monday or Tuesday during the academic year, except on school and national holidays, to enjoy structured activities around campus.','',0,'https://www.instagram.com/bereabuddies/','https://www.berea.edu/centers/center-for-excellence-in-learning-through-service/programs/berea-buddies','https://www.facebook.com/BereaBuddies'),(3,'Berea Teen Mentoring',NULL,1,0,'Kori Kobylak','bereateenmentoring@berea.edu','Berea Teen Mentoring (BTM) brings Berea community youth, from ages 13-18, into a group setting for mentorship and enrichment programs. Staff members are assisted during the weekly program by Berea College student volunteers, who act as mentors for these program participants. The mission of the program is to stimulate and cultivate personal growth for young adults in the Berea community.','',0,'https://www.instagram.com/bereateenmentoring/','https://www.berea.edu/centers/center-for-excellence-in-learning-through-service/programs/berea-teen-mentoring','https://www.facebook.com/BereaTeenMentoring'),(4,'Berea Tutoring',NULL,1,0,'Fay Moore','bereatutoring@berea.edu','Berea Tutoring provides an encouraging atmosphere for local students who need help in achieving academic success, and for college volunteers who want to learn more about teaching or volunteering. Our mission is to increase conceptual understanding in academic subject areas, enrich educational experiences, and build self-confidence by providing college-aged tutors to local school children.','',0,'https://www.instagram.com/bereatutoring/','https://www.berea.edu/centers/center-for-excellence-in-learning-through-service/programs/berea-tutoring','https://www.facebook.com/CELTSbereatutoring'),(5,'Habitat for Humanity',NULL,1,0,'Maria Elkins','habitat@berea.edu','Through the work of Habitat for Humanity International, thousands of low-income families have found hope through affordable housing. Hard work and volunteering have resulted in the organization sheltering more than two million people worldwide.','',0,'https://www.instagram.com/bc_habitat/','https://www.berea.edu/centers/center-for-excellence-in-learning-through-service/programs/habitat-for-humanity','https://www.facebook.com/profile.php?id=100068874352425'),(6,'Hispanic Outreach Program',NULL,1,0,'Brandon Zuniga','hop@berea.edu','The Hispanic Outreach Program (HOP) is a service-learning effort which brings together CELTS, several community organizations, and the Department of Foreign Languages at Berea College. HOP aims to build bridges among the Spanish-speaking and English-speaking residents of Madison County.','',0,'https://www.instagram.com/hop.bc_/','https://www.berea.edu/centers/center-for-excellence-in-learning-through-service/programs/hispanic-outreach-program','https://www.facebook.com/HOPBerea'),(7,'People Who Care',NULL,1,0,'Kimberly Tamayo-Quinones','pwc@berea.edu','People Who Care (PWC) helps to connect Berea College students with organizations and opportunities that promote change through advocacy, education, action, and direct community service. Volunteers may serve at local shelters, work with the Fair Trade University Campaign, or help to raise awareness about local issues like domestic violence, homelessness, fair trade, and AIDS awareness education. Students are welcome to participate as volunteers in PWC’s projects.','',0,'https://www.instagram.com/pwc_bc/','https://www.berea.edu/centers/center-for-excellence-in-learning-through-service/programs/people-who-care-program','https://www.facebook.com/peoplewhocareBC'),(8,'Hunger Initiatives',NULL,0,0,'','','Each year 200 people stand in line to get into Woods-Penniman for the Annual Empty Bowls Event sponsored by the Berea College ceramics students and CELTS. Students, faculty, staff and community members each pay $10 for a beautiful bowl, soup and the privilege of helping those in need in our community.',NULL,0,'https://www.instagram.com/p/CxwGHLTJMgS/','',''),(9,'CELTS-Sponsored Event',NULL,0,0,'','','CELTS hosts many events that are not under the umbrella of one of our existing programs','',1,'','https://www.berea.edu/centers/center-for-excellence-in-learning-through-service','https://www.facebook.com/BereaCollegeCELTS'),(10,'Bonner Scholars',NULL,0,1,'Sarah Rohrer','','The Bonner Scholars Program is a unique opportunity for students who want to combine a strong commitment to service with personal growth, teamwork, leadership development, and scholarship. Students who have completed an application for the Berea College class of 2026 may apply to be a Bonner Scholar.','',0,'','https://www.berea.edu/centers/center-for-excellence-in-learning-through-service/bonner-scholars-program','');
/*!40000 ALTER TABLE `program` ENABLE KEYS */;
UNLOCK TABLES;

